import React from 'react';
import Navbar from '../../react-components/navbar/Navbar.js';
import Sidebar from '../../react-components/sidebar/Sidebar.js';
import Feed from '../../react-components/feed/Feed.js';
import Rightbar from '../../react-components/rightbar/Rightbar.js';
import "./profile.css";

function Profile() {
    return (
        <>
         <Navbar/>
         <div className="profile"> 
           <Sidebar/>
           <div className="profileRight">
               <div className="profileRightTop">
                 <div className="profileCover">
                    <img src="/images/post/5.jpg" alt="" className="profileCoverImage" /> 
                    <img src="/images/person/1.jpg" alt="" className="profileUserImage" />  
                 </div>
                 <div className="profileInfo">
                     <h4 className = "profileInfoName">Connor yo</h4>
                     <span className="profileInfodescription">It 's my description</span>
                 </div>
               </div>
               <div className="profileRightBottom">
                   <Feed/>
                   <Rightbar profile/>
               </div> 
           </div>
         </div>
        </>
    )
}

export default Profile
